import React from 'react';
import { Route, Navigate } from 'react-router-dom';

// ProtectedRoute will protect the routes that require authentication
const ProtectedRoute = ({ element, ...rest }) => {
  const token = localStorage.getItem('token'); // Check if a token exists (could be JWT)

  return (
    <Route 
      {...rest} 
      element={token ? element : <Navigate to="/login" />} // Redirect to login if not authenticated
    />
  );
};

export default ProtectedRoute;
